const Expectation = () =>{

    return(
        <div className="square expectation">
            <h1>Expectativas</h1>
            <ul>
                <li>Eqiovoxarme tanto que aprenda en el camino</li>
                <li>Despertar más cuirosidad en mí por React</li>
                <li>Estado de México</li>
                <li>Estudiante de Ciencias de la computación</li>
            </ul>
        </div>
    )
}

export default Expectation;
